import logo from './logo.svg';
import './App.css';

function App() {

  const listArray = [
    { name: "jajko" },
    { name: "cebulka"},
    { name: "herbata"},
    { name: "kawusia"}
  ]

  const list = listArray.map(( list =>
    <form> 
      <checkbox
        type="checkbox"       
        name="main"
        value={list.name}
      />
    </form>
    ))

  return (
    <div>
      {list}
    </div>
  );
}

export default App;
